import React,{useState} from 'react';
import ReactDOM from 'react-dom';

const New = () =>{
  return(
    <div>
      <h1>Meetup Form</h1>
      <form>
      <label>
        Name:
        <input type="text" /><br />
        Id:
        <input type="number" /><br />
        Password
        <input type="password" />
      </label>

      </form>
    </div>
  )
}

export default New;
